import { Box } from '@mui/material'
import React from 'react'
import CategoryItem from './CategoryItem'

const Categories = (props) => {
  return (
    <Box sx={{position : 'relative'  , width:'100%' , p : '20px'}}>
       <div>
          {props.data.map((item)=>{
                return (
                   <Box key={item.id || item}
                   id
                   >

                   </Box>
                )
          })}
       </div>
    </Box>
  )
}

export default Categories
